import React from "react";
import ReactDOM from "react-dom";
import Link from "next/link";
import { Menu, Input, Button } from "antd";

const { Search } = Input;

const AppLayout = ({ children }) => {
    return (
        <>
            <Menu mode="horizontal">
                <Menu.Item key="home">
                    <Link href="/">
                        <a>Home</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key="profile">
                    <Link href="/profile">
                        <a>Profile</a>
                    </Link>
                </Menu.Item>
                <Menu.Item key="signup">
                    <Link href="/signup">
                        <a>Signup</a>
                    </Link>
                </Menu.Item>
                <Search placeholder="input search text" onSearch={(value) => console.log(value)} style={{ width: 200, verticalAlign: "middle" }} />
            </Menu>

            {children}
        </>
    );
};

export default AppLayout;
